import React from 'react';

function Card(props) {
	console.log(props.myContacts.imgURL);
	return(
		<div className='card'>
			<div className='top'>
				<h2 className='name'>{props.myContacts.name}</h2>
			</div>
			<div className='bottom'>
				<p className='info'>{props.myContacts.phone}</p>
				<p className='info'>{props.myContacts.email}</p>
			</div>
		</div>
	)
}

export default Card;
